import React from "react";
import { Routes, Route } from "react-router-dom";

import Home from "../Pages/Home/Home";

function ReactRoutes() {
  return (
    <>
      <Routes>
      <Route element={<Layout />}>
          <Route path="/" element={<Home />} />
        </Route>
      </Routes>
    </>
  );
}

export default ReactRoutes;
